function editsrconFileSelect(event) {
  const file = event.files[0];
  editsrcFile.value = file;
  const reader = new FileReader();
  reader.onload = async (e) => {
    editsrc.value = e.target.result;
  };
  reader.readAsDataURL(file);
}

