// delete modal
let deleteRegion = ref();
let deleteModal = ref(false);
const updateDeleteModal = (value) => {
  deleteModal.value = value;
};

let loading = ref(false);
let About = ref();
const getInfo = async () => {
  loading.value = true;
  if (locale.value === "ar") {
    const { data: productsData, pending } = await useFetch(`${api.GetAbout}`, {
      baseURL: apiBase,
      credentials: "include",
      headers: {
        "accept-language": "ar",
      },
    });
    watchEffect(() => {
      if (process.client) {
        if (productsData.value) {
          About.value = productsData.value;
        }
      }
    });
  } else {
    const { data: productsData, pending } = await useFetch(`${api.GetAbout}`, {
      baseURL: apiBase,
      credentials: "include",
      headers: {
        "accept-language": "en",
      },
    });
    watchEffect(() => {
      if (process.client) {
        if (productsData.value) {
          About.value = productsData.value;
        }
      }
    });
  }
  loading.value = false;
};
//init
getInfo();

const DeleteCat = async () => {
  const { RemovePlant, error } = await useFetch(
    `${api.DeleteAbout}/${deleteRegion.value.id}`,
    {
      credentials: "include",
      baseURL: apiBase,
      method: "DELETE",
    }
  );

  // re get the product
  getInfo();

  deleteModal.value = false;
  //message
  locale.value === "en"
